import React, { Component } from "react";
 
class Projects extends Component {
  render() {
    return (
      <div>
        <h2>PROJECTS</h2>
        <p>WIP.</p>
        <p>。°。°。(*´￫ܫ￩｀*)。°。°。</p>
      </div>
    );
  }
}
 
export default Projects;
